            <h3>Video Library</h3>
            </div>

           
            {/* // searchbox and searchicon */}

             <div className="headerInput">
             <input type="text"  placeholder="Search"/>
             </div>

    {/* // Three Icons  */}

    
    <div className="iconsbox">
    <i class="fa fa-clock"></i>
    <i class="fa fa-music cursor"></i>
    <i class="fa fa-history cursor"></i>
    </div>



        

        </div>
    );
}
